  [],\n\t\"revision_timestamp\": \"2016-07-15T04:24:55.892128\",\n\t\"name\": \"medicares-physician-quality-reporting-system-pqrs-0c37a\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"<p>Medicares Physician Quality Reporting
  System (PQRS) allows providers to report measures of process quality and health
  outcomes. The authors of Medicares Physician Quality Reporting System (PQRS), Quality
  Measurement and Beneficiary Attribution, published in Volume 4, Issue 2, of Medicare
  and Medicaid Research Review, examined the characteristics of PQRS reports and the
  providers who file them, and compared beneficiary attribution based upon PQRS reports
  versus attribution based upon the plurality of non-hospital evaluation and management
  (NH-EM) visits. Medical specialists and primary care providers were most likely
  to submit a PQRS report, most frequently e-prescribing, electronic health records,
  and process quality measures. Reporting providers were involved with 17 percent
  of the beneficiarys NH-EM visits in 2009 compared to fifty percent for the provider
  of the plurality of NH-EM visits. PQRS reporting alone cannot solve the inherent
  attribution problem in traditional fee-for-service Medicare, but as participation
  increases, it could help improve both attribution and information about the quality
  of health care services delivered to Medicare beneficiaries.</p>n\",\n\t\"license_title\":
